// App.js or your main routing component
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Login';
import DoctorHome from './components/DoctorHome'; // Import your DoctorHome component
import ClinicalHome from './components/ClinicalHome'; // Import your ClinicalHome component
import AdminHome from './components/AdminHome'; // Import your AdminHome component

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/doctor-home" element={<DoctorHome />} />
        <Route path="/clinical-home" element={<ClinicalHome />} />
        <Route path="/admin-home" element={<AdminHome />} />
        {/* Add any additional routes as needed */}
      </Routes>
    </Router>
  );
}

export default App;
